import './Header.css'
import React from 'react';

export default function Header() {
    return (
        <Header>
            <Header.Item>
                <Header.Link href="#">About</Header.Link>
            </Header.Item>
            <Header.Item>
                <Header.Link href="#">Releases</Header.Link>
            </Header.Item>
            <Header.Item>
                <Header.Link href="#">Team</Header.Link>
            </Header.Item>
        </Header>
    );
}
